<!DOCTYPE html>
<html lang="ja">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Today's Gut Report - Flower Guts Project</title>
  <link href="https://fonts.googleapis.com/css2?family=Zen+Maru+Gothic:wght@400;500;700&display=swap" rel="stylesheet">
  <style>
    :root {
      --main: #B4705A;
      --main-light: #C4877A;
      --bg: #FAF8F5;
      --sub-bg: #F5F1EC;
      --text-dark: #5A4A42;
      --text-light: #8B7B73;
      --white: #FFFFFF;
    }
    * { box-sizing: border-box; margin: 0; padding: 0; }
    body {
      font-family: "Zen Maru Gothic", sans-serif;
      background-color: var(--bg);
      min-height: 100vh;
      padding: 20px;
      padding-bottom: 40px;
    }
    .container {
      max-width: 480px;
      margin: 0 auto;
    }
    .header {
      text-align: center;
      margin-bottom: 24px;
    }
    .title {
      font-size: 24px;
      font-weight: 700;
      color: var(--main);
      letter-spacing: 2px;
    }
    .subtitle {
      font-size: 12px;
      color: var(--text-light);
      margin-top: 4px;
    }
    .card {
      background-color: var(--white);
      border-radius: 20px;
      padding: 24px;
      margin-bottom: 16px;
      box-shadow: 0 2px 8px rgba(180, 112, 90, 0.08);
    }
    .welcome-card {
      background-color: var(--white);
      border-radius: 20px;
      padding: 24px;
      text-align: center;
      box-shadow: 0 2px 8px rgba(180, 112, 90, 0.08);
    }
    .welcome-emoji { font-size: 48px; margin-bottom: 16px; }
    .welcome-title { font-size: 18px; font-weight: 700; color: var(--text-dark); margin-bottom: 8px; }
    .welcome-text { font-size: 14px; color: var(--text-light); line-height: 1.6; }
    .mode-prompt {
      text-align: center;
      margin: 24px 0 16px;
      font-size: 14px;
      color: var(--text-dark);
    }
    .mode-button {
      width: 100%;
      padding: 16px 20px;
      margin-bottom: 12px;
      border: 2px solid transparent;
      border-radius: 16px;
      cursor: pointer;
      text-align: left;
      display: flex;
      align-items: center;
      gap: 12px;
      background-color: var(--sub-bg);
      transition: all 0.2s ease;
    }
    .mode-button:hover {
      border-color: var(--main);
      background-color: var(--white);
    }
    .mode-button.recommended {
      background-color: var(--main);
      color: var(--white);
    }
    .mode-emoji { font-size: 24px; }
    .mode-info { flex: 1; }
    .mode-name { font-size: 16px; font-weight: 700; color: var(--text-dark); }
    .mode-button.recommended .mode-name { color: var(--white); }
    .mode-desc { font-size: 12px; color: var(--text-light); margin-top: 2px; }
    .mode-button.recommended .mode-desc { color: rgba(255,255,255,0.9); }
    .mode-time {
      font-size: 12px;
      color: var(--main);
      background-color: rgba(180, 112, 90, 0.1);
      padding: 4px 8px;
      border-radius: 8px;
    }
    .mode-button.recommended .mode-time {
      color: var(--white);
      background-color: rgba(255,255,255,0.2);
    }
    .logo {
      width: 100px;
      height: 100px;
      display: block;
      margin: 24px auto 0;
    }
    .footer {
      text-align: center;
      margin-top: 32px;
      padding-top: 16px;
      border-top: 1px solid var(--sub-bg);
      font-size: 11px;
      color: var(--text-light);
      letter-spacing: 0.5px;
    }
    .question {
      font-size: 18px;
      font-weight: 700;
      color: var(--text-dark);
      margin-bottom: 20px;
      text-align: center;
    }
    .label {
      display: block;
      font-size: 14px;
      font-weight: 500;
      color: var(--text-dark);
      margin-bottom: 8px;
      margin-top: 16px;
    }
    .label:first-of-type { margin-top: 0; }
    .input {
      width: 100%;
      padding: 14px 16px;
      border: 2px solid var(--sub-bg);
      border-radius: 12px;
      font-size: 16px;
      font-family: inherit;
      background-color: var(--sub-bg);
      color: var(--text-dark);
      transition: all 0.2s ease;
    }
    .input:focus {
      outline: none;
      border-color: var(--main);
      background-color: var(--white);
    }
    .date-grid {
      display: grid;
      grid-template-columns: repeat(7, 1fr);
      gap: 4px;
      margin: 12px auto 0;
      max-width: 320px;
    }
    .date-button {
      aspect-ratio: 1;
      display: flex;
      flex-direction: column;
      align-items: center;
      justify-content: center;
      background-color: var(--sub-bg);
      border: 2px solid transparent;
      border-radius: 8px;
      cursor: pointer;
      font-size: 12px;
      font-weight: 500;
      color: var(--text-dark);
      transition: all 0.2s ease;
      padding: 2px;
      min-width: 36px;
    }
    .date-button:hover { border-color: var(--main); }
    .date-button.selected {
      background-color: var(--main);
      color: var(--white);
      border-color: var(--main);
    }
    .date-num { display: block; font-size: 14px; }
    .date-day { display: block; font-size: 9px; opacity: 0.8; }
    .option-button {
      width: 100%;
      padding: 14px 16px;
      margin-bottom: 10px;
      border: 2px solid transparent;
      border-radius: 14px;
      cursor: pointer;
      text-align: left;
      display: flex;
      align-items: center;
      gap: 12px;
      background-color: var(--sub-bg);
      transition: all 0.2s ease;
    }
    .option-button:hover { border-color: var(--main); }
    .option-button.selected {
      background-color: var(--main);
      color: var(--white);
      border-color: var(--main);
    }
    .option-emoji { font-size: 24px; }
    .option-label { font-size: 15px; font-weight: 500; color: var(--text-dark); }
    .option-button.selected .option-label { color: var(--white); }
    .option-sub { font-size: 12px; color: var(--text-light); margin-left: 8px; }
    .option-button.selected .option-sub { color: rgba(255,255,255,0.8); }
    .checkbox-grid {
      display: grid;
      grid-template-columns: repeat(2, 1fr);
      gap: 10px;
    }
    .checkbox-button {
      padding: 12px;
      border: 2px solid transparent;
      border-radius: 12px;
      cursor: pointer;
      text-align: center;
      background-color: var(--sub-bg);
      transition: all 0.2s ease;
    }
    .checkbox-button:hover { border-color: var(--main); }
    .checkbox-button.selected {
      background-color: rgba(180, 112, 90, 0.1);
      border-color: var(--main);
    }
    .checkbox-label { font-size: 14px; font-weight: 500; color: var(--text-dark); }
    .checkbox-sub { font-size: 11px; color: var(--text-light); margin-top: 4px; }
    .all-button {
      width: 100%;
      padding: 12px;
      margin-top: 12px;
      border: 2px solid var(--main);
      border-radius: 12px;
      cursor: pointer;
      font-size: 14px;
      font-weight: 500;
      background-color: var(--white);
      color: var(--main);
      transition: all 0.2s ease;
    }
    .all-button.selected {
      background-color: var(--main);
      color: var(--white);
    }
    .amount-grid {
      display: flex;
      gap: 10px;
      justify-content: center;
    }
    .amount-button {
      flex: 1;
      padding: 14px 16px;
      border: 2px solid transparent;
      border-radius: 12px;
      cursor: pointer;
      text-align: center;
      font-size: 14px;
      font-weight: 500;
      background-color: var(--sub-bg);
      color: var(--text-dark);
      transition: all 0.2s ease;
    }
    .amount-button:hover { border-color: var(--main); }
    .amount-button.selected {
      background-color: var(--main);
      color: var(--white);
      border-color: var(--main);
    }
    .textarea {
      width: 100%;
      padding: 14px 16px;
      border: 2px solid var(--sub-bg);
      border-radius: 12px;
      font-size: 15px;
      font-family: inherit;
      background-color: var(--sub-bg);
      color: var(--text-dark);
      resize: none;
      min-height: 100px;
      transition: all 0.2s ease;
    }
    .textarea:focus {
      outline: none;
      border-color: var(--main);
      background-color: var(--white);
    }
    .nav-buttons {
      display: flex;
      gap: 12px;
      margin-top: 20px;
    }
    .nav-button {
      flex: 1;
      padding: 14px;
      border: none;
      border-radius: 12px;
      cursor: pointer;
      font-size: 15px;
      font-weight: 600;
      font-family: inherit;
      transition: all 0.2s ease;
    }
    .nav-button.back {
      background-color: var(--sub-bg);
      color: var(--text-dark);
    }
    .nav-button.next {
      background-color: var(--main);
      color: var(--white);
    }
    .nav-button:disabled {
      opacity: 0.5;
      cursor: not-allowed;
    }
    .progress-bar {
      height: 4px;
      background-color: var(--sub-bg);
      border-radius: 2px;
      margin-bottom: 20px;
      overflow: hidden;
    }
    .progress-fill {
      height: 100%;
      background-color: var(--main);
      border-radius: 2px;
      transition: width 0.3s ease;
    }
    .result-card {
      background-color: var(--white);
      border-radius: 20px;
      padding: 24px;
      box-shadow: 0 2px 8px rgba(180, 112, 90, 0.08);
    }
    .result-title {
      font-size: 20px;
      font-weight: 700;
      color: var(--text-dark);
      text-align: center;
      margin-bottom: 20px;
    }
    .encouragement {
      background-color: rgba(180, 112, 90, 0.1);
      border-radius: 16px;
      padding: 16px;
      margin-bottom: 20px;
      font-size: 14px;
      line-height: 1.8;
      color: var(--text-dark);
    }
    .report-box {
      background-color: var(--sub-bg);
      border-radius: 12px;
      padding: 16px;
      margin-bottom: 16px;
    }
    .report-text {
      font-size: 13px;
      line-height: 1.8;
      color: var(--text-dark);
      white-space: pre-wrap;
    }
    .copy-button {
      width: 100%;
      padding: 16px;
      border: none;
      border-radius: 12px;
      cursor: pointer;
      font-size: 16px;
      font-weight: 600;
      font-family: inherit;
      background-color: var(--main);
      color: var(--white);
      transition: all 0.2s ease;
    }
    .copy-button.copied {
      background-color: #6B9B6B;
    }
    .reset-button {
      width: 100%;
      padding: 14px;
      margin-top: 12px;
      border: 2px solid var(--sub-bg);
      border-radius: 12px;
      cursor: pointer;
      font-size: 14px;
      font-weight: 500;
      font-family: inherit;
      background-color: var(--white);
      color: var(--text-light);
      transition: all 0.2s ease;
    }
    .step-indicator {
      text-align: center;
      font-size: 12px;
      color: var(--text-light);
      margin-bottom: 8px;
    }
    .hidden { display: none; }
  </style>
</head>

// Get steps based on mode
function getSteps() {
  if (mode === 'easy') {
    return ['nameDate', 'poopState', 'poopAmount', 'poopSatisfaction', 'poopSmell', 'greenMonster', 'greenMonsterAmount', 'mood', 'freeText'];
  }
  if (mode === 'normal') {
    return ['nameDate', 'poopState', 'poopAmount', 'poopSatisfaction', 'poopSmell', 'greenMonster', 'greenMonsterAmount', 'mago', 'mood', 'freeText'];
  }
  if (mode === 'full') {
    return ['nameDate', 'poopState', 'poopAmount', 'poopSatisfaction', 'poopSmell', 'greenMonster', 'greenMonsterAmount', 'mago', 'sleep', 'water', 'meals', 'stomachCondition', 'bodyCondition', 'skinCondition', 'exercise', 'mood', 'freeText'];
  }
  return [];
}

// Should skip step?
function shouldSkipStep(stepName) {
  if (stepName === 'poopAmount' && formData.poopState === 'none') return true;
  if (stepName === 'poopSatisfaction' && formData.poopState === 'none') return true;
  if (stepName === 'poopSmell' && formData.poopState === 'none') return true;
  if (stepName === 'greenMonsterAmount' && formData.greenMonster !== 'yes') return true;
  return false;
}

// Get next valid step
function getNextStep(current) {
  const steps = getSteps();
  let next = current + 1;
  while (next < steps.length && shouldSkipStep(steps[next])) {
    next++;
  }
  return next;
}

// Get previous valid step
function getPrevStep(current) {
  const steps = getSteps();
  let prev = current - 1;
  while (prev >= 0 && shouldSkipStep(steps[prev])) {
    prev--;
  }
  return prev;
}

// Get February dates
function getFebruaryDates() {
  const dayNames = ['Êó•', 'Êúà', 'ÁÅ´', 'Ê∞¥', 'Êú®', 'Èáë', 'Âúü'];
  const dates = [];
  for (let i = 1; i <= 28; i++) {
    const dayOfWeek = (i - 1) % 7;
    dates.push({ day: i, dayName: dayNames[dayOfWeek] });
  }
  return dates;
}

// Select mode
function selectMode(selectedMode) {
  mode = selectedMode;
  currentStep = 0;
  document.getElementById('mode-screen').classList.add('hidden');
  document.getElementById('question-screen').classList.remove('hidden');
  renderQuestion();
}

// Update progress

  const steps = getSteps();
  const progress = ((currentStep + 1) / steps.length) * 100;
  document.getElementById('progress-fill').style.width = progress + '%';
  document.getElementById('step-indicator').textContent = `${currentStep + 1} / ${steps.length}`;
}

// Select date
function selectDate(day) {
  formData.date = day;
  renderQuestion();
}

// Select single option with auto-advance
function selectSingle(field, value) {
  formData[field] = value;
  setTimeout(() => {
    const nextStep = getNextStep(currentStep);
    if (nextStep >= getSteps().length) {
      showResult();
    } else {
      currentStep = nextStep;
      renderQuestion();
    }
  }, 300);
}

// Toggle mago item
function toggleMago(itemId) {
  if (formData.magoItems.includes(itemId)) {
    formData.magoItems = formData.magoItems.filter(id => id !== itemId);
  } else {
    formData.magoItems.push(itemId);
  }
  renderQuestion();
}

// Toggle all mago
function toggleAllMago() {
  if (formData.magoItems.length === 8) {
    formData.magoItems = [];
  } else {
    formData.magoItems = magoItems.map(m => m.id);
  }
  renderQuestion();
}

// Toggle exercise
function toggleExercise(exerciseId) {
  if (exerciseId === 'none') {
    formData.exercise = ['none'];
  } else {
    formData.exercise = formData.exercise.filter(id => id !== 'none');
    if (formData.exercise.includes(exerciseId)) {
      formData.exercise = formData.exercise.filter(id => id !== exerciseId);
    } else {
      formData.exercise.push(exerciseId);
    }
  }
  renderQuestion();
}

// Go back
function goBack() {
  const prevStep = getPrevStep(currentStep);
  if (prevStep >= 0) {
    currentStep = prevStep;
    renderQuestion();
  }
}

// Go next
function goNext() {
  const steps = getSteps();
  const stepName = steps[currentStep];
  
  // Validation for nameDate
  if (stepName === 'nameDate' && (!formData.name.trim() || !formData.date)) {
    return;
  }
  
  const nextStep = getNextStep(currentStep);
  if (nextStep >= steps.length) {
    showResult();
  } else {
    currentStep = nextStep;
    renderQuestion();
  }
}

// Get encouragement message
function getEncouragementMessage() {
  const { poopState, greenMonster, mood, bodyCondition, exercise, magoItems: mago } = formData;
  
  if (poopState === 'banana' && greenMonster === 'yes' && mago.length === 8 && exercise.length > 0 && !exercise.includes('none') && mood === 'great') {
    const msgs = encouragementMessages.perfect;
    return msgs[Math.floor(Math.random() * msgs.length)];
  }
  if (poopState === 'banana') {
    const msgs = encouragementMessages.banana;
    return msgs[Math.floor(Math.random() * msgs.length)];
  }
  if (poopState === 'none' && greenMonster === 'yes') {
    const msgs = encouragementMessages.noneWithGrimon;
    return msgs[Math.floor(Math.random() * msgs.length)];
  }
  if (poopState === 'none' && greenMonster === 'forgot') {
    const msgs = encouragementMessages.noneWithoutGrimon;
    return msgs[Math.floor(Math.random() * msgs.length)];
  }
  if (greenMonster === 'later') {
    const msgs = encouragementMessages.relaxed;
    return msgs[Math.floor(Math.random() * msgs.length)];
  }
  if ((bodyCondition === 'tired' || bodyCondition === 'unwell') && greenMonster === 'yes') {
    const msgs = encouragementMessages.tiredButTried;
    return msgs[Math.floor(Math.random() * msgs.length)];
  }
  if (mood === 'bad' && greenMonster === 'yes') {
    const msgs = encouragementMessages.moodBadButTried;
    return msgs[Math.floor(Math.random() * msgs.length)];
  }
  const msgs = encouragementMessages.default;
  return msgs[Math.floor(Math.random() * msgs.length)];
}

  }
  
  if (formData.freeText.trim()) {
    report += `\nüíå „Å≤„Å®„Åì„Å®„ÉªÊòéÊó•„Å∏„ÅÆÊÑèÊ∞óËæº„ÅøÔºö\n${formData.freeText}\n`;
  }
  
  return report;
}

// Show result
function showResult() {
  document.getElementById('question-screen').classList.add('hidden');
  document.getElementById('result-screen').classList.remove('hidden');
  
  document.getElementById('encouragement').textContent = getEncouragementMessage();
  document.getElementById('report-text').textContent = generateReport().replace(/\\n/g, '\n');
}

// Copy report
function copyReport() {
  const report = generateReport().replace(/\\n/g, '\n');
  navigator.clipboard.writeText(report).then(() => {
    const btn = document.getElementById('copy-btn');
    btn.textContent = '‚úÖ „Ç≥„Éî„Éº„Åó„Åæ„Åó„ÅüÔºÅ';
    btn.classList.add('copied');
    setTimeout(() => {
      btn.textContent = 'üìã „Ç≥„Éî„Éº„Åô„Çã';
      btn.classList.remove('copied');
    }, 2000);
  });
}

// Reset form
function resetForm() {
  mode = null;
  currentStep = 0;
  formData = {

    stomachCondition: '',

    skinCondition: '',
    exercise: [],
    mood: '',

  };
  document.getElementById('result-screen').classList.add('hidden');
  document.getElementById('mode-screen').classList.remove('hidden');
}
